import React from 'react'

export default function VideoPlayer({VideoData}) {
  return (
    <>
    <div>
     <center>

     <iframe width="560" height="315" src={`https://www.youtube.com/embed/${VideoData.id.videoId}`} title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
     </center>
    </div>
    </>
  )
}
